import React, { Children } from 'react';
import Header from "./header"
import Home from "./home"
import Portfolio from "./portfolio"
// import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Switch>
      <Route exact path="/">
       <Home />
    </Route>
     <Route path="/portfolio">
        <About />
    </Route>
  </Switch>
  )
}

export default App;
